import React from "react";
import JobCard from "./JobCard";
const JobList = ({jobs, company}) => {
    return (
        <div>
        {jobs.map(j => <JobCard title={j.title} equity={j.equity} salary={j.salary} company={company}/>)}
        </div>
    )
}
export default JobList;
